DELIMITER $$
CREATE TRIGGER `evita_duplicados` BEFORE INSERT ON `contactos` FOR EACH ROW BEGIN
    DECLARE existe INT;

    -- Verificar si ya existe un contacto con el mismo nombre y teléfono
    SELECT COUNT(*) INTO existe
    FROM contactos
    WHERE nombre = NEW.nombre AND telefono = NEW.telefono;

    -- Si existe, cancelar la inserción
    IF existe > 0 THEN
        SIGNAL SQLSTATE '45000'
        SET MESSAGE_TEXT = 'No se puede insertar un contacto duplicado';
    END IF;
END
$$
DELIMITER ;

